function App() {
  return (
    <main className="p-10 w-[500px] m-auto">
      <header className="flex justify-between"><Link to={"/"}>Flowrite</Link>
      <nav className="">
        <Link to={"/"}>Login</Link>
        <Link to={"/"}>Register</Link>
      </nav>
        </header>
    </main>
  );
}

export default App;
